import React from 'react';

import './ExpensesList.css';
import ExpenseItem from './ExpenseItem';

const ExpenesList = (props) => {
  let expensesContent = <p>No expenses found.</p>;

  if(props.filteredExpenses.length === 0){
    return <h2 className="expense-list__fallbak">Found no expenses.</h2>
  }
  if (props.filteredExpenses.length === 1) {
    expensesContent = (
      <div>
        {props.filteredExpenses.map((expense) => (
          <ExpenseItem
            title={expense.title}
            amount={expense.amount}
            date={expense.date}
            key={expense.id}
          />
        ))}
        <p>Only single Expense here. Please add more...</p>
      </div>
    );
  }

  return <ul classname="expense-list">{props.filteredExpenses.map((expense) => (
      <ExpenseItem
        title={expense.title}
        amount={expense.amount}
        date={expense.date}
        key={expense.id}
      />
    ))}</ul>;
}

export default ExpenesList;
